import React from "react";

const Menu = () => {
  return (
    <nav>
      <div id="menu" className="collapse navbar-collapse">
        <ul>
          <li className="menu-item">
            <a href="#">electronics</a>
          </li>
          <li className="menu-item">
            <a href="#">jewelery</a>
          </li>
          <li className="menu-item">
            <a href="#">men's clothing</a>
          </li>
          <li className="menu-item">
            <a href="#">women's clothing</a>
          </li>
        </ul>
      </div>
    </nav>
  );
};
export default Menu;
